import React from "react";
import Navbar from "./Navbar";
const Header = () => {
  return (
    <div id="main">
      <Navbar />
      <div className="name">
        <h1>
          It's a <span>ReactJS</span> Website
        </h1>
        <p className="details"> hahahahahaha haha haha</p>
      </div>
    </div>
  );
};

export default Header;
